import React from "react";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from "@mui/material";

const OwnerHome = () => {
  return (
    <div
      style={{
        background: "linear-gradient(to bottom, #a3a4a8, #f9f9f9)",
        padding: "20px",
      }}
    >
      <TableContainer component={Paper}>
        <Table
          style={{
            minWidth: 650,
          }}
        >
          <TableHead>
            <TableRow>
              <TableCell
                style={{
                  fontWeight: "bold",
                }}
              >
                Header 1
              </TableCell>
              <TableCell
                align="right"
                style={{
                  fontWeight: "bold",
                }}
              >
                Header 2
              </TableCell>
              <TableCell
                align="right"
                style={{
                  fontWeight: "bold",
                }}
              >
                Header 3
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <TableRow>
              <TableCell>Row 1, Cell 1</TableCell>
              <TableCell align="right">Row 1, Cell 2</TableCell>
              <TableCell align="right">Row 1, Cell 3</TableCell>
            </TableRow>
            <TableRow>
              <TableCell>Row 2, Cell 1</TableCell>
              <TableCell align="right">Row 2, Cell 2</TableCell>
              <TableCell align="right">Row 2, Cell 3</TableCell>
            </TableRow>
            {/* Add more rows as needed */}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default OwnerHome;
